   If you instead mean "exactly 5", change the condition to "chipsf = 5".
   If you mean "rows whose chipsf is the minimum for their object and that minimum equals 5", see the alternative query below. */
WITH target_oids AS (
  SELECT oid FROM (VALUES 
    ('ZTF23abjikaf'),
    ('ZTF20achlced')
  ) AS v(oid)
)
SELECT COUNT(*) AS n_rows_chipsf_at_least_5
FROM dataquality dq
WHERE dq.oid IN (SELECT oid FROM target_oids)
  AND dq.chipsf >= 5;

